import React from 'react';
import Header from './Header';
import './style.css';

function App() {
  return (
    <div className="App">
      <div className="stars"></div>
      <Header />

      <section id="about" className="section">
        <h2>Sobre mí</h2>
        <div className="about-grid">
          <div className="about-box">
            <h3>Experiencia Laboral</h3>
            <p>Detalles de tu experiencia profesional...</p>
          </div>
          <div className="about-box">
            <h3>Formación Académica</h3>
            <div className="education-container">
              {[
                { 
                  title: 'Master en Marketing Digital', 
                  logo: '/marketing_logo.png', 
                  year: '2023',
                  institution: 'Universidad XYZ'
                },
                { 
                  title: 'Grado en Administración de Empresas', 
                  logo: '/business_logo.png', 
                  year: '2020',
                  institution: 'Universidad ABC'
                },
                { 
                  title: 'Curso Avanzado de SEO', 
                  logo: '/seo_logo.png', 
                  year: '2022',
                  institution: 'Escuela Digital'
                },
                { 
                  title: 'Especialización en Redes Sociales', 
                  logo: '/social_logo.png', 
                  year: '2021',
                  institution: 'Instituto Marketing'
                },
                { 
                  title: 'Analítica Web con Google Analytics', 
                  logo: '/analytics_logo.png', 
                  year: '2022',
                  institution: 'Academia Digital'
                },
                { 
                  title: 'Publicidad en Google Ads', 
                  logo: '/ads_logo.png', 
                  year: '2021',
                  institution: 'Google Academy'
                }
              ].map((education, index) => (
                <div key={index} className="education-item">
                  <div className="education-icon-container">
                    <img 
                      src={education.logo} 
                      alt={education.title} 
                      className="education-icon"
                    />
                  </div>
                  <div className="education-details">
                    <h4>{education.title}</h4>
                    <p className="education-institution">{education.institution}</p>
                    <div className="education-year">{education.year}</div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>

      {/* Resto de tu código permanece igual */}
    </div>
  );
}

export default App;
